import React from 'react'

function Dog(props) {

    function clickHandler(e) {
        props.clickHandler(props.dog[0])
    }

    return(
        <>
            <img alt="" src={props.dog[0].image}/>
             <h2>{props.dog[0].name}</h2>
             {props.dog[0].isGoodDog ? 
                <button onClick={clickHandler}>Good Dog!</button> :
                <button onClick={clickHandler}>Bad Dog!</button>}
       </>
    )
}

export default Dog
